import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import LandingPage from './components/LandingPage';
import TourBooking from './components/TourBooking'; // Create these components later
import TicketReservation from './components/TicketReservation';
import RideBooking from './components/RideBooking';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={LandingPage} />
        <Route path="/tour-booking" component={TourBooking} />
        <Route path="/ticket-reservation" component={TicketReservation} />
        <Route path="/ride-booking" component={RideBooking} />
      </Switch>
    </Router>
  );
}

export default App;
